import { Grid, Typography } from "@material-ui/core";
import React from "react";

function individual_Bank({ data }) {
  return (
    <Grid container spacing={2}>
      <Grid item xs={6}>
        <Typography variant="subtitle1" color="primary">
          {" "}
          {data.bank_name}
        </Typography>
      </Grid>
    </Grid>
  );
}

export default individual_Bank;
